  false,\n\t\"url\": null,\n\t\"notes\": \"This archive contains 97 projections of
  monthly BCSD CMIP5 projections of hydrology over the contiguous United States. This
  archive includes meteorological variables forcing the simulation, such as precipitation
  and temperature, and model output including soil moisture, runoff, and evapotranspiration.
  These projections are a translation of monthly CMIP5 downscaled climate projections
  using the Variable Infiltration Capacity (VIC) hydrologic model. For more information
  visit http://gdo-dcp.ucllnl.org/downscaled_cmip_projections/\",\n\t\"license_title\":
